
CREATE TABLE `client` (
  `id_client` int unsigned NOT NULL AUTO_INCREMENT,
  `nom` varchar(255) NOT NULL,
  `email` varchar(155) NOT NULL,
  `nationalite` varchar(155) NOT NULL,
  `id_reservation` int unsigned NOT NULL,
  `id_hotel` int unsigned NOT NULL,
  `id_itineraire` int unsigned NOT NULL,
  PRIMARY KEY (`id_client`),
  KEY `id1` (`id_client`,`id_reservation`),
  KEY `tbl_reservation` (`id_reservation`),
  KEY `id2` (`id_client`,`id_hotel`),
  KEY `tbl_hotel` (`id_hotel`),
  KEY `id3` (`id_client`,`id_itineraire`),
  KEY `tbl_itineraire` (`id_itineraire`),
  CONSTRAINT `tbl_hotels` FOREIGN KEY (`id_hotel`) REFERENCES `hotels` (`id_hotels`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tbl_itineraire` FOREIGN KEY (`id_itineraire`) REFERENCES `itineraire` (`id_itineraire`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tbl_reservation` FOREIGN KEY (`id_reservation`) REFERENCES `reservation` (`id_reservation`) ON DELETE CASCADE ON UPDATE CASCADE
);


